import React from 'react';
import ReactDOM from 'react-dom';
import * as serviceWorker from './serviceWorker';
import Form from './template/form/main';

serviceWorker.register();

const forminit = {
    id : '',
    class : '223',
    method : 'get',
    token : 'token',
    hash : 'hash',
    inputs : [{
            icon:'',
            name:'name',
            type:'text',
            value:'张宇',
        }, {
            icon:'',
            name:'sex',
            type:'text',
            value:'男',
        }, {
            icon:'',
            name:'text',
            type:'text',
            value:'2018',
        }, {
            icon:'',
            type:'textarea',
            value:'2018',
        },
    ]
};

ReactDOM.render(<Form forminit={forminit} />, document.getElementById('app'));

serviceWorker.unregister();
